,1679046523642,1679904380924,5003,'zhangmin46','zhangmin46'),(9,1,'editor','中国四大黄茶','中国四大黄茶分别为蒙顶黄芽、平阳黄汤、君山银针、霍山黄芽。 蒙顶黄芽：成茶芽条匀整，扁平挺直，甘醇鲜爽，为黄茶之极品。 平阳黄汤：具有“干茶显黄，汤色杏黄、叶底嫩黄”的“三黄”特征。 君山银针：其茶芽头茁壮，茶芽内面呈金黄色，白毫显露，雅称“金镶玉”。 霍山黄芽：其茶挺直微展，香气清香持久，滋味浓厚鲜醇回甘。','[{\"id\":12,\"name\":\"测试标\",\"tagType\":10},{\"id\":15,\"name\":\"测试哦\",\"tagType\":14}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/010A72D8A0794F1397703D0E553C5A8A.png',NULL,NULL,0,0,0,NULL,4,0,'192.168.1.100',0,5003,1681354758310,0,1681354758310,'zhangmin46','mock'),(10,19,'editor','测试文章','1','[{\"id\":12,\"name\":\"测试标\",\"tagType\":10},{\"id\":15,\"name\":\"测试哦\",\"tagType\":14}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/2A9B6F7A17D948FE91D56BC862E2CF95.png',NULL,NULL,0,0,0,NULL,0,0,'127.0.0.1',0,5003,1679969980111,5003,1679969980112,'zhangmin46','zhangmin46'),(11,8,'editor','碧螺春和龙井的区别是什么','碧螺春和龙井在产地、树种、外形、香气、滋味上均有区别。 产地：碧螺春产于江苏苏州，龙井产于浙江杭州。 树种：碧螺春为“柳条茶”、“竹梢茶”，龙井为群体中、龙井43。 外形：碧螺春条索纤细、匀整，卷曲似螺，龙井扁平光滑，略带黄色，条形整齐。 香气：碧螺春为花果香，龙井为豆花香、高火香。 滋味：碧螺春鲜爽、回甘，龙井清雅、浑厚。','[{\"id\":12,\"name\":\"测试标\",\"tagType\":10},{\"id\":15,\"name\":\"测试哦\",\"tagType\":14}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/D5C0F264BA7A41D6A7DB300FB47C041F.png',NULL,NULL,0,0,0,NULL,6,0,'192.168.1.100',0,5003,1681351557300,0,1681351557300,'zhangmin46','mock'),(12,6,'editor','喝茶的时候，搭配这些点心更“巴适”','喝茶的点心','[{\"id\":12,\"name\":\"测试标\",\"tagType\":10},{\"id\":15,\"name\":\"测试哦\",\"tagType\":14}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/A1BD8669BF6C4E30A376A3B316AEB19A.png',NULL,NULL,0,0,0,NULL,10,0,'192.168.1.100',0,0,1681349724513,0,1681349724513,'mock','mock'),(13,8,'editor','茶叶干燥方式有哪些','茶叶干燥方式主要有烘干、炒干和晒干三种形式，干燥的主要目的为固定茶叶形态，形成独有的香气、滋味特征。常见的干燥设备有斗式烘干机、链板式烘干机、烘焙提香机、复干机、瓶式炒干机、八角式炒干机、圆筒式炒干机、辉干机等','[{\"id\":12,\"name\":\"测试标\",\"tagType\":10}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/A9A5BB33B23F425487CFDB0FEB9DDE3E.png',NULL,NULL,0,0,0,NULL,2,0,'192.168.1.100',0,0,1681349218384,0,1681349218384,'mock','mock'),(14,32,'editor','绿茶为什么不用洗茶','绿茶之所以不用洗茶，主要是因为耐泡度低、细嫩程度高、易析出，洗茶会造成风味流失。 耐泡度低：绿茶没有发酵，一般可冲泡3次左右，洗茶则没有必要。 细嫩度高：绿茶原料嫩度高，含芽率高，洗茶则无法尝到真味。 易析出：绿茶物质丰厚，析出速度较快，洗茶会使得香气、滋味流失。','[{\"id\":18,\"name\":\"java下专题\",\"tagType\":5},{\"id\":23,\"name\":\"java下专题11\",\"tagType\":5}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/60D935F30CCE49ED8379B5BB3D1A2BC5.png',NULL,NULL,0,0,0,NULL,1,0,'192.168.1.100',0,0,1681355106563,0,1681355106563,'mock','mock'),(15,32,'editor','泡茶前，醒茶怎么醒','泡茶前，可采用拆散或热水浸泡醒茶，即湿醒、干醒两种。 湿醒：将茶叶放入盖碗，使用开水正常冲泡，并利用水分、氧气，激发茶香，最后将其倒掉。 干醒：将撬好的干茶放在茶叶罐中静置一段时间，或者在烫洗过的盖碗中摇晃醒茶。','[{\"id\":26,\"name\":\"java下的第一个专题\",\"tagType\":5}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/AFA9BAF4F9D3491D8994AE8D47E07199.png',NULL,NULL,1,1,0,NULL,5,1,'192.168.1.100',0,0,1681295889080,0,1681295889080,'mock','mock'),(16,31,'editor','红玫瑰花茶可以冷泡吗','红玫瑰花茶可以冷泡，冷泡的玫瑰花茶相比热饮而言，其口感具有清凉、甘甜等特点，且没有明显的苦涩，鲜香清爽，沁人心脾，冷泡所使用茶具一般为玻璃杯、瓷杯为佳，且需要带盖，另外冷泡玫瑰花茶耗费时间更长，一般需要4~8小时。','[{\"id\":22,\"name\":\"java下专题\",\"tagType\":5}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/05DFF5F9CF5D41CA96E762AD47B176DD.png',NULL,NULL,0,0,0,NULL,0,0,'192.168.1.100',0,0,1681355359320,0,1681355359320,'mock','mock'),(17,31,'editor','玫瑰茶的泡法用量','玫瑰茶的泡法','[{\"id\":22,\"name\":\"java下专题\",\"tagType\":5}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/D640CB98E27B4E2D89348971EBED1B17.png',NULL,NULL,0,0,0,NULL,0,0,'192.168.1.100',0,0,1681355617951,0,1681355617951,'mock','mock'),(18,31,'editor','金银花用多少度水泡合适','金银花用多少度水泡合适','[{\"id\":22,\"name\":\"java下专题\",\"tagType\":5}]',0,'http://dev.img.p.yufeiworld.com/tea_attach/94C0A775D118415188A92AC9EF2333B7.png',NULL,NULL,0,0,0,NULL,0,0,'192.168.1.100',0,0,1681356012509,0,1681356012509,'mock','mock');
