INSERT INTO `content_detail` VALUES (1,'详情',2,5003,1677491447495,NULL,NULL,'zhangmin46',NULL),(2,'详情',3,5003,1677492758675,NULL,NULL,'zhangmin46',NULL),(3,'详情',4,5003,1677579016447,NULL,NULL,'zhangmin46',NULL),(4,'详情',5,5003,1677656927347,NULL,NULL,'zhangmin46',NULL),(5,'详情',6,5003,1677658461205,NULL,NULL,'zhangmin46',NULL),(6,'你日她弄个哈哈哈',7,5003,1678092663237,NULL,NULL,'zhangmin46',NULL),(7,'详情内容',8,5003,1679046523640,NULL,NULL,'zhangmin46',NULL),(8,'<h2 class=\"ql-align-justify\">中国黄茶有哪些</h2><p class=\"ql-align-justify\"><strong>1、蒙顶黄芽</strong></p><p class=\"ql-align-justify\">四川蒙顶山是有名的产茶名区，产茶由来已久，且茶叶多闻名于茶界；</p><p class=\"ql-align-justify\">蒙顶黄芽采摘于蒙顶山山区，每年于清明节前采摘鳞片开展的圆肥单芽，成茶芽条匀整，扁平挺直，色泽黄润，金毫显露；汤色黄中透碧，甜香鲜嫩，甘醇鲜爽，为黄茶之极品。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/73AA1E0A27194AADA19327BE10B53B2C.png\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>2、君山银针</strong></p><p class=\"ql-align-justify\">君山银针是有名的银针茶，产茶区只存在于洞庭湖上的君山岛。</p><p class=\"ql-align-justify\">君山银针由单芽制成，属黄芽茶，每年只在清明前后采摘，并只摘春茶的首轮嫩芽，加工也极为严格复杂，步骤多、耗时久，因此成茶品质优、特点强。</p><p class=\"ql-align-justify\">从外形看，芽头肥硕茁壮、银毫满披，冲泡后呈现出“群笋出土”，“金枪林立”和“三起三落”等奇特景观。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/90B8E4E64A604F0DB24A48654198864C.png\"></p><p class=\"ql-align-justify\"><strong>3、霍山黄芽</strong></p><p class=\"ql-align-justify\">霍山黄芽产自于安徽省六安市霍山县，山区林密雨多，土壤肥沃，茶叶自然生长，因为茶芽肥壮，内含物良多。</p><p class=\"ql-align-justify\">霍山黄芽的制作方法曾一度失传，后经茶叶专家和技术人员恢复和创新。</p><p class=\"ql-align-justify\">成茶外形微扁紧直，形如雀舌，颜色金黄，白毫显露，汤色黄绿，香醇浓郁，有板栗香气，叶底微黄明亮。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/748E4E01F97E43408DD3E18FBFBD44C9.png\"></p><p class=\"ql-align-justify\"><strong>4、平阳黄汤</strong></p><p class=\"ql-align-justify\">“平阳黄汤”茶属于六大茶类黄茶类中的黄小茶，与君山银针、蒙顶黄芽、霍山黄芽并称中国四大传统黄茶。</p><p class=\"ql-align-justify\">平阳县的“平阳黄汤”，历史悠久，乾隆年间曾被列为贡品，品质以南雁荡山区所产为最佳，故名“平阳黄汤”，以“干茶显黄、汤色杏黄、叶底嫩黄”享誉茶界。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/DDFBE9196A344630915AD458F028C7FE.png\"></p><h2 class=\"ql-align-justify\">除此之外，黄茶还有诸多品种</h2><p class=\"ql-align-justify\"><strong>1、海马宫茶</strong></p><p class=\"ql-align-justify\">产于贵州省大方县，它的特点是：条索紧结卷曲，茸毛显露，香高味醇，回味甘甜，汤色黄绿明亮，叶底嫩黄匀整。</p><p class=\"ql-align-justify\"><strong>2、北港毛尖</strong></p><p class=\"ql-align-justify\">产于湖南省岳阳北港的邕湖一带，它的品质特点是：外形芽壮叶肥，白毫显露，冲泡后，香气清高，滋味醇厚，汤色金黄，叶底黄明。</p><p class=\"ql-align-justify\"><strong>3、 莫干黄芽</strong></p><p class=\"ql-align-justify\">产于浙江德清的莫干山，它的品质特点是：外形紧细成条，有如莲心，色泽黄嫩油润，冲泡后，香气清鲜，滋味醇爽，汤色澄黄，叶底明成朵。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><img src=\"//:0\"></p>',9,5003,1679902222938,0,1681354758310,'zhangmin46','mock'),(9,'<p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/3F1277CE31DE48FD8E3AED32317C651F.png\">11111111</p>',10,5003,1679907893780,5003,1679969980109,'zhangmin46','zhangmin46'),(10,'<h2 class=\"ql-align-justify\">碧螺春和龙井的区别是什么</h2><p class=\"ql-align-justify\"><strong>1、产地</strong></p><p class=\"ql-align-justify\">龙井茶，主要产地为浙江杭州西湖风景区，现分为西湖产区、 钱塘产区、 越州产区三大产地。</p><p class=\"ql-align-justify\">碧螺春，即洞庭碧螺春，主要产地为苏州市吴县太湖的洞庭山。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/2338AB5AB874423AB6A1D7AD91646458.png\"></p><p class=\"ql-align-justify\"><strong>2、历史文化</strong></p><p class=\"ql-align-justify\">碧螺春，唐代即为钦点贡品。曾用品：“吓煞人香”。康熙帝下江南尝此茶后，根据其卷曲成螺、色泽碧绿的形态，赐名“碧螺春”。碧螺春历史悠久，改名后“运势”一发不可收拾。</p><p class=\"ql-align-justify\">龙井，具有1200多年历史，明代列为上品，清顺治列为贡品。清乾隆游览杭州西湖时尝此茶，盛赞不已，将龙井村胡公庙前的十八棵茶树封为“御茶”。龙井茶后来者居上，自此名扬天下。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/05E890FFBE184ECEB73731401BEC010D.png\"></p><p class=\"ql-align-justify\"><strong>3、树种</strong></p><p class=\"ql-align-justify\">制作碧螺春的品种，有当地的群体种，又叫“柳条茶”、“竹梢茶”，特点是细而窄瘦；还有近几年培育的一些小山种品种；还有大白茶的一些品种。</p><p class=\"ql-align-justify\">制作龙井茶 的，也有当地的群体种，比如老茶蓬老龙井，还有鸠坑种、龙井43、龙井长叶等。</p><p class=\"ql-align-justify\">4、外观</p><p class=\"ql-align-justify\">碧螺春，茶如其名。条索纤细、匀整，卷曲似螺，白毫显露，色泽碧绿。</p><p class=\"ql-align-justify\">龙井，扁平光滑，色泽嫩绿、略带黄色，条形整齐，宽度一致。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/EA02F40E67774618AC043A4D1E0E531B.png\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>5、工艺</strong></p><p class=\"ql-align-justify\">因两者均属绿茶，均采用炒青的制作工艺，所以在制作工艺上差别不大。</p><p class=\"ql-align-justify\">相较龙井，碧螺春多了一项独特的工艺——搓团显毫。正是这道工艺，才使碧螺春白毫显露。</p><p class=\"ql-align-justify\">龙井茶品质，则和采摘时间密不可分。“清明”前三天采摘的称“明前茶”，此时嫩芽初迸，如同莲心，故又叫“莲心茶”，是西湖龙井茶中的珍品。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/0F7D196180C54D9C9DC246A8E3985BA4.png\"></p><p class=\"ql-align-justify\"><strong>6、口感</strong></p><p class=\"ql-align-justify\">碧螺春茶汤淡绿，清香袭人，口味凉甜，独具天然茶香果味。这得益于产区内茶树、果树相间种植。茶吸果香，花窨茶味，成就了碧螺春的独特品质。</p><p class=\"ql-align-justify\">龙井茶汤清澈、甘香不冽，初品清淡、香气清醇持久。正宗狮峰龙井会有浓郁的豆香味，且回甘浑厚持久。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/E33178C127094D5096627E016351FC19.png\"></p><p class=\"ql-align-justify\">总结</p><p class=\"ql-align-justify\">两者，同属于绿茶，均为十大名茶之一。</p><p class=\"ql-align-justify\">龙井为浙江名优产品，具有悠久的历史，独特的豆花香，清爽、甘醇，色翠、形美、香郁、味醇冠绝天下，让人难以忘怀。</p><p class=\"ql-align-justify\">碧螺春为江苏名优产品，历史同样悠久，”“铜丝条，螺旋形，浑身毛，花香果味，鲜爽生津”，同时有着吓煞人香的美誉。</p><p><br></p>',11,5003,1679993822198,0,1681351557300,'zhangmin46','mock'),(11,'<p class=\"ql-align-justify\">此时正值新茶之季，在喝茶的过程中，配上一点茶点，合适的茶点不仅可以解决人们在饮茶时的饥饿感，更是给茶品提分的重要筹码。</p><p class=\"ql-align-justify\">只要搭配得当，两者不仅不会冲突，而且还会提升茶汤的口感。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/3A19C555608A44D48C7F0D0130BA5E9B.png\"></p><p class=\"ql-align-justify\">比如，江西省赣北地区盛产茶，尤其以九江庐山云雾茶闻名。</p><p class=\"ql-align-justify\">当地居民居于本土茶品特性，开发出九江茶饼、酥糖、糍粑、艾米果等经典伴茶茶点。</p><p class=\"ql-align-justify\">这些茶点大多以当地土产为原料，外形精致小巧，口味清甜独特，配合云雾茶清香茶味，可谓相得益彰。</p><p class=\"ql-align-justify\">正所谓：赏庐山丽景，品云雾香茗，食九江名点，是为人生一大逍遥乐事。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/6232E4BFEEF649D69DB1B7BC3BB7804C.png\"></p><p class=\"ql-align-justify\">还有福建省的闽南地区和广东省的潮汕地区喜欢喝工夫茶的人很多。</p><p class=\"ql-align-justify\">泡工夫茶讲究浓、香，所以都要佐以小点心。</p><p class=\"ql-align-justify\">主要有南糖，绿豆茸馅饼、椰饼、绿豆糕等，还有具有闽南特色的“芋枣”，另外还有各种膨化食品及蜜饯。</p><p class=\"ql-align-justify\">平时家人、朋友在一起品茶、尝点，其乐融融。</p><p class=\"ql-align-justify\">再有，老北京也有许多茶馆，与南方茶馆有所不同。</p><p class=\"ql-align-justify\">老北京的清茶馆较少，而书茶馆却很流行，品茶只是辅助性的，听评书才是主要的，所以品茶时的茶点多为瓜子等零嘴，很是随意。</p><p class=\"ql-align-justify\">但在北京有一种茶馆叫“红炉馆”，做的全是满汉点心，小巧玲珑，有大八件、小八件，主要有北京的艾窝窝、蜂糕、排叉、盆糕、烧饼等，顾客可边品茶，边品尝茶点。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/7031DEA0F08B45C0AA2B5EACD0F1E18F.png\"></p><p class=\"ql-align-justify\">当然，除了地方特色的茶点，也有几种已经被大多数人认可的搭配方式：</p><p class=\"ql-align-justify\">绿茶、黄茶搭配甜的糕点，如凤梨酥、芝士蛋糕。</p><p class=\"ql-align-justify\">绿茶鲜爽，有时口感会有些苦涩，可以搭配甜的点心。像日本的抹茶很苦，所以茶点通常都会很甜。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/F263BAF626044CB4806C5D2E24D86553.png\"></p><p class=\"ql-align-justify\">乌龙茶搭配咸口的干果，如花生、瓜子。</p><p class=\"ql-align-justify\">乌龙茶是半发酵茶，口感介于绿茶和红茶之间，品饮时重韵，茶汤过喉徐徐生津，用咸鲜的点心来配，能保留茶的香气，不破坏原有的滋味。</p><p class=\"ql-align-justify\">红茶搭配酸甜的食品，如蜜饯、果脯。</p><p class=\"ql-align-justify\">红茶的滋味醇厚浓郁，回甘很好，配上一些酸的点心，会产生令人愉悦的酸甜口感。</p><p class=\"ql-align-justify\">普洱搭配饱腹的小食，如春卷、粽子。</p><p class=\"ql-align-justify\">普洱的味道能很好地包容甜度高和偏油的点心，使得它们在入口后不那么腻，对于双方来说都是一个味觉的提升。</p><p class=\"ql-align-justify\">而且，普洱茶具有很好的消脂解腻的作用。因此可以选择比较油的点心，像含油的酥饼、各类肉制品等，都是不错的选择。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/3501F14F3AF14F4686BE5079557174C0.png\"></p><p class=\"ql-align-justify\">最后总的来说，一壶上等的茶品，些许佐茶的点心，再加上完全放松的心情，品茶也会更有趣味。</p><p class=\"ql-align-justify\">不知道茶友们平时喝茶是不是也会搭配茶点呢？通常都喜欢什么样的茶点呢？</p><p><br></p>',12,0,1680508924052,0,1681349724513,'mock','mock'),(12,'<p class=\"ql-align-justify\">干燥是茶叶初加工的后道工序，主要是通过热能蒸发茶叶水分，形成茶叶特定的香气、滋味，固化外形，便于贮存保质。</p><p class=\"ql-align-justify\">茶叶干燥的作用主要有：</p><p class=\"ql-align-justify\">一是蒸发水分，固化外形；</p><p class=\"ql-align-justify\">二是利用高温制止残余酶作用，防止变色；</p><p class=\"ql-align-justify\">三是形成特定的香气和滋味。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/ABF966249D814E5580329017A438109E.png\"></p><p class=\"ql-align-justify\">茶叶干燥过程中影响其品质的因素主要有干燥方式、干燥次数、干燥温度、干燥时间和投叶量等。</p><p class=\"ql-align-justify\">茶叶干燥过程中，要根据茶叶的失水规律和理化特性变化特点，分次干燥（根据茶叶的不同品质要求，可分两次或多次不等），每次干燥之前需适当摊凉回潮，保证茶叶水分散失均匀，达到最佳的干燥效果。</p><p class=\"ql-align-justify\">分次干燥时需要掌握好干燥温度、时间和投叶量三者之间的参数关系，第一次干燥以蒸发水分和制止残余酶活性为主，投叶量要少，干燥时间要短且温度适当高些；</p><p class=\"ql-align-justify\">后续干燥是形成茶叶色香味形的关键阶段，温度应适当降低，投叶量适度增多，干燥时间逐渐延长。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/1AACDD90F863441383C1E7823195F2FC.png\"></p><p class=\"ql-align-justify\">常见的茶叶干燥方式有烘干、炒干和烘炒结合等。烘干，利用热空气对茶叶进行加热，从而使得茶叶蒸发水分实现干燥的一种方式。</p><p class=\"ql-align-justify\">采用烘干方式进行干燥的茶叶多呈自然状，香气清新，滋味鲜爽，如黄山毛峰、六安瓜片等。炒干，利用锅壁和滚筒筒体内表面的热对茶叶进行加热，进而使茶叶蒸发水分实现干燥的一种方式。采用炒干方式进行干燥的茶叶，条索紧结，香高味醇，如西湖龙井、三杯香、松萝茶等。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/D33097B466D545029974AB6B0A6640CB.png\"></p><p class=\"ql-align-justify\">以下为绿茶的干燥方式</p><p class=\"ql-align-justify\">1、炒干</p><p class=\"ql-align-justify\">指干燥以炒为主（或全部炒干），形成香气浓郁高爽，滋味浓醇厚爽的炒青绿茶风格。其中，龙井就是大家最为熟知的炒青绿茶。</p><p class=\"ql-align-justify\">2、烘干</p><p class=\"ql-align-justify\">指干燥以烘为主（或全部烘干），形成的是香气清高鲜爽，滋味清醇甘爽的风格。烘青绿茶的香味不及炒青绿茶浓郁。典型的烘青绿茶有黄山毛峰、六安瓜片、太平猴魁等。</p><p class=\"ql-align-justify\">3、晒干</p><p class=\"ql-align-justify\">指干燥以晒干为主（或全部晒干），形成的是香气较高，滋味浓厚，有日晒气味的晒青绿茶风格。晒青绿茶以云南大叶种的品质最好，称为“滇青”。</p><p><br></p>',13,0,1680517886585,0,1681349218384,'mock','mock'),(13,'<p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/0451A2E5759D4A2ABCE0EC136C769C32.png\"></p><p class=\"ql-align-justify\">对于小昵而言，冲泡绿茶个人是不建议洗茶的。</p><p class=\"ql-align-justify\">因为在洗茶过程当中，我们感觉能够洗去少许的杂质（其实正规生产的茶品， 杂质基本没有，因为现在是工业自动化时代，不是以前的简陋加工环境，所以没有那个必要）。</p><p class=\"ql-align-justify\">同时，在洗茶时，你也会浪费茶叶第一泡的精华，因为绿茶是不发酵茶，并且许多都是嫩芽、一芽一叶等制成，富含多种营养成分，在我们向其中注入热水之后，15秒钟以内50%的营养成分会被挥发出来。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/CD55B57C171848A0BB89050C9975A1EF.png\"></p><p class=\"ql-align-justify\">3分钟左右，茶汤稍凉，就可以饮用，连续2~3杯，基本上，再泡也没什么味道。</p><p class=\"ql-align-justify\">所以，相比其他茶类的茶品，绿茶的耐泡度非常有限；</p><p class=\"ql-align-justify\">如果我们洗茶的话会使大量的营养成分流失，风味、香气自然是不完整的；</p><p class=\"ql-align-justify\">所以为了保留绿茶的香气和口感，还有它的内质，我们不建议对绿茶进行洗茶，尤其是明前茶这些特别讲究鲜爽的茶叶，更不建议洗茶。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/AC8108BC216D4A18A66AFEB3F5A928A1.png\"></p><p class=\"ql-align-justify\">当然，洗不洗茶，没有明确的规定，如果是遇见粗老的茶叶，一些放置时间较长的茶叶，还是可以清洗一下的，但洗茶或者说醒茶的速度一定要快，快速注水，快速出汤即可。</p><p class=\"ql-align-justify\">另外，在一些重要场合，如接待重要朋友、客人，也可以洗茶，因为这种情况洗茶主要表达的是对对方的尊重、尊敬，这时候洗茶就很有必要，同时也能让对方觉着干净，喝的舒心，并且认为你是一个有讲究的人，当然自己喝就不要太讲究，爱面子。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/C53569607EDD4261B695513BDB32BEF5.png\"></p><p class=\"ql-align-justify\">最后我想和大家说的是，现在国家对于茶的制作工艺中卫生标准都有很高的要求；</p><p class=\"ql-align-justify\">其中，并没有杂质、灰尘等，所以说，只要购买的正规生产产品，则不用过分去担心茶叶的卫生状况。</p><p class=\"ql-align-justify\">换句话来说，合格的绿茶是不需要洗茶的，不合格的绿茶也不是洗一洗就能解决问题的。</p><p><br></p>',14,0,1681269277128,0,1681355106563,'mock','mock'),(14,'<p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/9CF85E0DB14C4BF8B8141231F65A3FAD.jpg\"></p><p class=\"ql-align-justify\"><strong>醒茶的意思</strong></p><p class=\"ql-align-justify\">醒，指睡眠状态结束或还没入睡。而醒茶，指的是让茶叶结束休眠过程，恢复清醒状态。</p><p class=\"ql-align-justify\">醒茶，讲得简单点，就是要让茶叶从沉睡状态里清醒过来。</p><p class=\"ql-align-justify\"><strong>茶，要怎么醒</strong></p><p class=\"ql-align-justify\">醒茶，其实很好实现，只要将茶叶暴露在空气中（有条件的与空气接触）一定时间即可。在空气中水分和温度的刺激下，茶叶自然会彻底清醒。</p><p class=\"ql-align-justify\"><strong>为什么要醒茶</strong></p><p class=\"ql-align-justify\">醒茶，目的是为了让茶叶更好喝。像一袭沉睡许久的茶叶，内部物质处于一个休眠状态，此时如果将茶叶直接冲泡饮用，滋味和香气就会不好。</p><p class=\"ql-align-justify\">相反，经过醒茶，让 茶叶中的内含物剧烈运动着，能让茶叶中的香气物质和滋味物质充分释放，以丰富茶汤的味道，让茶变得更好喝。</p><h2 class=\"ql-align-justify\">醒茶的具体步骤</h2><p class=\"ql-align-justify\">1、取出放置</p><p class=\"ql-align-justify\">在确定要饮用哪一款茶，拆开包装纸箱、绵纸，拿到开放的环境放大概1个月，新茶的醒茶时间提前半个月即可，十五年以上的普洱茶至少应该提前2个月。</p><p class=\"ql-align-justify\"><strong>2、撬散放置</strong></p><p class=\"ql-align-justify\">经过第一步之后，先用茶刀或茶针将紧压状的茶饼、茶砖或茶沱撬开，解散。</p><p class=\"ql-align-justify\">然后 将撬散的茶块放置在醒茶罐中，醒茶罐宜选用陶罐或者紫砂罐，然后放在无光照直射、无异味、空气流通的环境中，上面盖上棉纸静置。</p><p class=\"ql-align-justify\">这个过程，根据不同的茶，需要时间7天至3个月。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/59FC51350F184494A4389D49D170BB1A.jpg\"></p><p class=\"ql-align-justify\"><strong>3、湿醒</strong></p><p class=\"ql-align-justify\">（泡茶时的用茶分量，不是整饼湿醒哦）</p><p class=\"ql-align-justify\">湿醒的过程，又称润茶。温壶之后将茶叶投入壶中，注入开水，3--5秒后出汤倒掉，其目的在于：提高茶叶及泡茶器具的温度，通过对茶叶进行温润浸泡，起到利于茶叶舒展和茶汁浸出的作用。</p><p class=\"ql-align-justify\">然后，静置10-30秒（静置时间根据茶饼压制的松紧度、新老程度灵活调整），让干茶充分吸收壶中的热气进行苏醒展开，再注水。湿醒在整个冲泡过程中，决定着茶叶内在品质的表现，对之后的冲泡有直接的影响。</p><p><br></p>',15,0,1681295889080,0,1681295889080,'mock','mock'),(15,'<p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/977175817F5C4C82BAA16528725A58FF.png\"></p><h2 class=\"ql-align-justify\">什么是冷泡茶</h2><p class=\"ql-align-justify\">冷泡茶，即以冷水来冲泡茶叶，而此处的冷水并非指冰水，是指凉开水或常温的矿泉水；</p><p class=\"ql-align-justify\">与传统的热茶泡法相比，冷水泡茶，茶叶的滋味会较难渗出，因此常需将茶叶泡上好几个小时方可饮用。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/35BB38D3C5034449B3DC866E4EE3A533.png\"></p><h2 class=\"ql-align-justify\">冷泡玫瑰花茶的特点</h2><p class=\"ql-align-justify\">冷泡玫瑰花茶因人体体温较茶汤高，带着香味分子的酮类物质会在茶汤到达口腔后才逐渐挥发起来，香浓盈满整个口腔，喉韵也更悠长。</p><p class=\"ql-align-justify\">同时，冷泡玫瑰花茶的颜色较之热玫瑰花茶也会相对清淡素雅，在炎炎夏日里令人倍感清新，降暑又解渴，是极佳的“夏日清凉特饮”。</p><p class=\"ql-align-justify\">冷泡茶与传统的热茶泡法相比，冷水泡茶，茶的滋味与营养会较难渗出，因此常需将茶泡上好几个小时方可饮用。</p><p class=\"ql-align-justify\">不同的茶种所需的冲泡时间也会产生变化，如玫瑰花茶需要4~8个小时。</p><p><br></p>',16,0,1681355359320,0,1681355359320,'mock','mock'),(16,'<p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/321449647E02443B9FE65F9185DD223F.png\"></p><p><span style=\"color: rgb(69, 69, 69);\">泡玫瑰花茶的冲泡方法与用量</span></p><p class=\"ql-align-justify\">1、备具</p><p class=\"ql-align-justify\">泡玫瑰花茶的茶具可以用瓷器、陶器，也可以用玻璃的茶具。</p><p class=\"ql-align-justify\">用玻璃茶具来冲泡玫瑰花茶，可观赏花朵在杯子里慢慢开放，颜色由透明变绿再变淡淡的紫红，是一种享受。</p><p class=\"ql-align-justify\">泡玫瑰花茶，用量可以不用太多，一般300ml左右的杯子，投入5~7颗玫瑰花即可。对于用水，矿泉水，纯水或者山泉水比较好。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/9D7F14B97DB24E75836B4390F4BABD62.png\"></p><p class=\"ql-align-justify\">2、温杯</p><p class=\"ql-align-justify\">烧开一壶水，将开水倒入杯具之中，充分浸润之后倒掉，此为温杯之用，便于释放茶香，之后将温杯之水倒掉即可。</p><p class=\"ql-align-justify\">3、投茶</p><p class=\"ql-align-justify\">将玫瑰花茶投入杯中，然后可以靠近，仔细品闻，纯正的花香悠然而来，放佛置身花的世界，顿时身心愉悦。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/596A2BAF3562465ABC3E78FCF60EE93A.png\"></p><p class=\"ql-align-justify\">4、冲泡</p><p class=\"ql-align-justify\">闻香之后，先注入茶杯1/4的水（不要一次注满），轻微旋转摇晃杯身，待玫瑰花浸润后，再注如剩余的水，七分满即可。</p><p class=\"ql-align-justify\">这样做的好处是可以将玫瑰花茶泡开，避免漂浮于水面。</p><p class=\"ql-align-justify\">5、品饮</p><p class=\"ql-align-justify\">注水后等待3~5分钟左右，即可品饮。</p><p class=\"ql-align-justify\">冲好的茶，宜热饮。热饮时花的香味浓郁，闻之沁人心脾。冲泡次数1到5次都可以，一般就三次。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/62C5D90F09314BC7BBDD4D11D5C4C035.png\"></p><p class=\"ql-align-justify\">玫瑰花茶的冲泡注意事项</p><p class=\"ql-align-justify\">1、玫瑰花最好不要与茶叶泡在一起喝。</p><p class=\"ql-align-justify\">2、泡玫瑰花的时，可根据个人的口味，加冰糖或蜂蜜，以减少玫瑰花的涩味，加强功效。</p><p class=\"ql-align-justify\">3、挑选购买玫瑰花茶时，要认真辨别玫瑰花茶。</p><p class=\"ql-align-justify\">4、水温不宜过低，一般为100℃。</p><p><br></p>',17,0,1681355617951,0,1681355617951,'mock','mock'),(17,'<p><br></p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/32765214E0724B068E2D6663C4C19E76.png\"></p><p class=\"ql-align-justify\">金银花用100℃水温冲泡，金银花属于花草茶，性寒，味甘，香气清幽，冲泡时需先将水烧开，然后投入适量金银花，用100℃水温冲泡，100℃是芳香、风味形成的关键因素，而过低的水温则无法释放金银花内的物质。</p><p class=\"ql-align-justify\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/D6B0A6E58BCA4AA1A7D2E73C02F734BD.png\"></p><p class=\"ql-align-justify\">金银花的冲泡方法</p><p class=\"ql-align-justify\">1、准备一只玻璃杯或瓷杯，3～6克金银花，烧开一壶水备用。</p><p class=\"ql-align-justify\">2、用开水将杯具烫洗一次，然后将洁具之水倒掉。</p><p class=\"ql-align-justify\">3、将金银花投入杯中，然后注入1/3的水，轻微旋转杯身，使其浸润。</p><p class=\"ql-align-justify\">4、待金银花轻微浸润之后，再次注水，七分满即可。</p><p class=\"ql-align-justify\">5、可以盖上杯盖，待3~5分钟左右，金银花茶就差不多冲泡好了，茶色黄绿明亮、清凉爽口，就可以进行品饮了。</p><p class=\"ql-align-justify\">揭开杯盖一侧，鼻闻汤中氤氲上升的香气，顿觉芬芳扑鼻而来，精神为之一振，有兴趣者，还可凑着香气作深呼吸，充分领略愉悦香气。</p><p><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/582C791FA2394B36A4C8DE4EAAFE7A12.png\"></p><p class=\"ql-align-justify\">金银花泡水为什么变绿</p><p class=\"ql-align-justify\">金银花泡水的颜色与其产地、花期等有很大的关系，不同花期的金银花泡出来茶的颜色会有所不同。</p><p class=\"ql-align-justify\">生长期的金银花颜色一般是从淡绿-淡黄-白色开始转变，一般来说，泡出来的水是淡黄色的。但由于花体中含有大量的绿原酸，本身就会产生绿色。</p><p class=\"ql-align-justify\">如果泡了后放上3~6小时以上，所含的绿原酸会与水溶解，颜色会慢慢加深，甚至会出现绿得发黑的情况，所以金银花茶放置时间过长或过夜后不宜再喝。</p><p><br></p>',18,0,1681356012509,0,1681356012509,'mock','mock');
