INSERT INTO `goods_detail` VALUES (9,'<p>222</p>',21,1680158104774),(10,'<p>22222</p>',21,1680158145148),(11,'<p>55555</p>',0,1680160132076),(17,'<p>6666</p>',0,1680161543238),(18,'<p>111111</p>',0,1680242065256),(19,'<p class=\"ql-indent-6\"><span class=\"ql-size-huge\"><img src=\"http://dev.img.p.yufeiworld.com/tea_attach/552D6B9690124E9A854C6871F133F298.jpeg\"></span><img src=\"http://120.46.197.40:9021/images/F1FD01B2F072491FBC870BAF4DBEE8CB.jpeg\"></p><h2>祁门红茶简称<a href=\"https://baike.baidu.com/item/%E7%A5%81%E7%BA%A2/50105?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">祁红</a>，茶叶原料选用当地的中叶、中生种茶树“槠叶种”（又名祁门种）制作，是中国历史名茶，著名<a href=\"https://baike.baidu.com/item/%E7%BA%A2%E8%8C%B6/185424?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">红茶</a>精品。由<a href=\"https://baike.baidu.com/item/%E5%AE%89%E5%BE%BD/37014?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">安徽</a>茶农创制于<a href=\"https://baike.baidu.com/item/%E5%85%89%E7%BB%AA/558952?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">光绪</a>年间，但史籍记载最早可追溯至<a href=\"https://baike.baidu.com/item/%E5%94%90%E6%9C%9D/53699?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">唐朝</a><a href=\"https://baike.baidu.com/item/%E9%99%86%E7%BE%BD/550560?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">陆羽</a>的<a href=\"https://baike.baidu.com/item/%E8%8C%B6%E7%BB%8F/3770?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">茶经</a>。产于安徽省<a href=\"https://baike.baidu.com/item/%E7%A5%81%E9%97%A8/10753994?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">祁门</a>、<a href=\"https://baike.baidu.com/item/%E4%B8%9C%E8%87%B3/10073790?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">东至</a>、<a href=\"https://baike.baidu.com/item/%E8%B4%B5%E6%B1%A0/5704556?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">贵池</a>（今池州市）、<a href=\"https://baike.baidu.com/item/%E7%9F%B3%E5%8F%B0/10754038?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">石台</a>、<a href=\"https://baike.baidu.com/item/%E9%BB%9F%E5%8E%BF/5294317?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">黟县</a>，以及<a href=\"https://baike.baidu.com/item/%E6%B1%9F%E8%A5%BF/215383?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">江西</a>的<a href=\"https://baike.baidu.com/item/%E6%B5%AE%E6%A2%81/1784414?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">浮梁</a>一带。</h2><h2>“祁红特绝群芳最，清誉高香不二门。”祁门红茶是<a href=\"https://baike.baidu.com/item/%E7%BA%A2%E8%8C%B6/185424?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">红茶</a>中的极品，享有盛誉，是<a href=\"https://baike.baidu.com/item/%E8%8B%B1%E5%9B%BD%E5%A5%B3%E7%8E%8B/2261792?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">英国女王</a>和王室的至爱饮品，高香美誉，香名远播，美称“<a href=\"https://baike.baidu.com/item/%E7%BE%A4%E8%8A%B3%E6%9C%80/4559371?fromModule=lemma_inlink\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">群芳最</a>”、“红茶皇后”。</h2>',0,1680602950205),(20,'<p class=\"ql-align-justify\"><strong>获得荣誉：</strong></p><p class=\"ql-align-justify\">1、1915年，巴拿马万国博览会金奖。</p><p class=\"ql-align-justify\">2、2007年11月，中国申奥第一茶。</p><p class=\"ql-align-justify\">3、2008年2月，“坦洋工夫”成功注册为“中国证明商标”。</p><p class=\"ql-align-justify\">4、2009年3月，“坦洋工夫”成为“福建省著名商标”。</p><p class=\"ql-align-justify\">5、2009年10月，“坦洋工夫”获得国家质量监督检验检疫总局批准的国家标准，成为第一个获得国家标准的本土产品。</p><p class=\"ql-align-justify\">6、2010年1月，“坦洋工夫”获中国驰名商标。</p><p class=\"ql-align-justify\">7、2013年4月，福建新坦洋茶业集团代表“坦洋工夫”再次荣获巴拿马国际博览会金奖。</p><p class=\"ql-align-justify\">8、2015年7月，“坦洋工夫”成为米兰世博会中国馆“全球合作伙伴”和“指定用茶”。</p><p class=\"ql-align-justify\"><strong>茶品诗词：</strong></p><p class=\"ql-align-justify\">香泉一合乳，煎作连珠沸。</p><p class=\"ql-align-justify\">时看蟹目溅，乍见鱼鳞起。</p><p class=\"ql-align-justify\">声疑松带雨，饽恐生烟翠。</p><p class=\"ql-align-justify\">尚把沥中山，必无千日醉。</p><p class=\"ql-align-justify\"><strong>二、广东</strong></p><p class=\"ql-align-justify\"><strong>3、英德红茶</strong></p><p class=\"ql-align-justify\"><strong>历史：</strong></p><p class=\"ql-align-justify\">种茶历史在1200年前唐朝就有了，1959年得到了国内外专家的认证。</p><p class=\"ql-align-justify\"><strong>习俗：</strong></p><p class=\"ql-align-justify\">来客不敬茶，不是好人家，英德茶乡把客来敬茶作为一种接待礼仪，只要家里来人就会泡茶迎接。</p><p class=\"ql-align-justify\"><strong>获得荣誉：</strong></p><p class=\"ql-align-justify\">1、2006年，英德红茶获评“国家原产地保护产品”。</p><p class=\"ql-align-justify\">2、2008年，获“中国红茶之乡”美誉。</p><p class=\"ql-align-justify\">3、2010年，获得国家地理标志证明商标”。</p><p class=\"ql-align-justify\">4、2013年，中国茶叶流通协会评选我市为“2013年度中国茶叶产业发展示范县”。</p><p class=\"ql-align-justify\">5、2014年，英德红茶被评选为“广东十件宝”旅游土特产。</p><p><br></p>',0,1680751951962),(21,'<p><strong>无忧险</strong></p><p>1、无忧险</p><p>京东茗茶联合阳光保险以及国内外知名茗茶品牌共同推出“茗茶无忧险”项目，凡购买自营茶叶的茶客们都将免费获得此保险一份。如果茶客在食用茗茶过程中出现产品问题，在取得第三方检测机构的鉴定报告后，可向我们发起理赔。</p><p>2、理赔流程</p><p>①获取报告——报告为国家认可的具备茗茶检测资质的第三方检测机构出具的检测报告</p><p>②出险报案——向京东客服400-606-5500发起理赔声明，再拨打阳光保险公司全国理赔热线95510</p><p>③资料提交——将购物凭证、发票、检测报告、出险通知和赔款收据等资料交给保险公司</p><p>④进行赔偿——资料核查无误后对您的损失进行赔付：假1赔3，最高赔付2万</p>',0,1680852046410),(22,'<p><strong>价格说明</strong></p><p>价格：商品在爱采购的展示标价，具体的成交价格可能因商品参加活动等情况发生变化，也可能随着购买数量不同或所选规格不同而发生变化，如用户与商家线下达成协议，以线下协议的结算价格为准，如用户在爱采购上完成线上购买，则最终以订单结算页价格为准。</p><p>抢购价：商品参与营销活动的活动价格，也可能随着购买数量不同或所选规格不同而发生变化，最终以订单结算页价格为准。</p><p>特别提示：商品详情页中（含主图）以文字或者图片形式标注的抢购价等价格可能是在特定活动时段下的价格，商品的具体价格以订单结算页价格为准或者是您与商家联系后协商达成的实际成交价格为准；如您发现活动商品价格或活动信息有异常，建议购买前先咨询商家。</p>',0,1680852009369);
