CREATE TABLE `order_main` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `user_id` bigint NOT NULL COMMENT '用户id',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户昵称',
  `order_no` varchar(50) NOT NULL COMMENT '订单编号',
  `goods_num` int NOT NULL COMMENT '商品数量',
  `goods_total_amounts` bigint DEFAULT '0' COMMENT '商品销售总价',
  `discount_total_amounts` bigint DEFAULT '0' COMMENT '优惠总金额（不计算运费优惠）',
  `goods_actual_total_amounts` bigint DEFAULT '0' COMMENT '商品实付总金额（优惠后）= 商品销售总价-优惠总金额（运费优惠不计算在内）',
  `freight_coupon_id` bigint DEFAULT '0' COMMENT '运费券id',
  `freight_amounts` bigint DEFAULT '0' COMMENT '运费总金额',
  `freight_actual_amounts` bigint DEFAULT '0' COMMENT '运费实际金额',
  `order_actual_total_amount` bigint DEFAULT '0' COMMENT '应付总价=商品优惠后价格+实际运费价格',
  `logistics_no` varchar(50) DEFAULT NULL COMMENT '物流单号',
  `pay_channel` int DEFAULT NULL COMMENT '支付渠道：1-支付宝，2-微信',
  `pay_method` int DEFAULT NULL COMMENT '支付方式:1-在线支付，2-货到付款',
  `order_type` int NOT NULL COMMENT '订单类型:1-普通，2-秒杀，3-虚拟商品',
  `order_channel` int NOT NULL COMMENT '订单来源：1-app，2-web',
  `cancel_reason_type` bigint DEFAULT '0' COMMENT '订单取消原因类型id',
  `cancel_reason` varchar(100) DEFAULT NULL COMMENT '取消原因',
  `buyer_remark` varchar(100) DEFAULT NULL COMMENT '买家备注',
  `platform_remark` varchar(100) DEFAULT NULL COMMENT '平台备注',
  `order_status` int NOT NULL DEFAULT '0' COMMENT '订单状态: 10:待支付, 20:已支付,待发货, 30:已发货/待收货, 40:确认收货/已完成,-10: 用户关闭, -20:平台关闭(商家), -30:系统调度关闭',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `paid_time` datetime DEFAULT NULL COMMENT '支付时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`),
  KEY `uk_order_no` (`order_no`)
) ENGINE=InnoDB AUTO_INCREMENT=1646438172159434754 DEFAULT CHARSET=utf8mb3 COMMENT='订单主表';
